Ant Attack (BBC)

Nature Documentary hosted by Andrew Sachs, published by BBC broadcasted as part of BBC Natural World series in 2006 - English narration


Information
------------------------------

A look at the bug-eat-bug world of the African driver ant, wildlife's neighbour from hell. The biggest family on Earth is a sinister army of 20 million sisters that thrives by ravaging forests, killing every living thing it can pin down and slice up. It is really a super-organism that dominates an often violent world, where miniature monsters roam and only the most powerful survive.

